import {IonPhaser} from "@ion-phaser/react";
import React from "react";
import Phaser from "phaser";


const PhaserMain = () => {

    const gameState = {
        initialize: true,
        game: {
            width: 1920,
            height: 1200,
            type: Phaser.AUTO,
            scene: {
                preload: preload,
                create: create,
                update: update,
            },
            physics: {
                default: 'arcade',
                arcade: {
                    gravity: {y: 300},
                    debug: false
                }
            },
        },
    }

    function preload() {
        this.load.image('sky', 'assets/sky1.png');
    }
    function create() {
        this.add.image(960, 600, 'sky');

    }
    function update() {
    }
    return (
        <div style={{minHeight: "100vh"}}>
            <IonPhaser game={gameState.game} initialize={gameState.initialize}/>
        </div>
    );
}
export default PhaserMain;
